import React from 'react'
import Search from './Search'
import Logo from './logo.png'
import AnimalForm from './AnimalForm'

export default function Header() {
  return (
    <div className="header-div">
        <img src={Logo} alt="logo" className="logo" />
        <Search /> 
        <AnimalForm />
    </div>
  )
}
